package qwert.register.successRegister;import com.fasterxml.jackson.annotation.JsonProperty;public class SuccessRegistrationPostField {    @JsonProperty("email")    private String email;    @JsonProperty("password")    private String password;    public SuccessRegistrationPostField(){}    public SuccessRegistrationPostField(String email, String password) {        this.password = password;        this.email = email;    }}